Туреччина 🇹🇷 Анталія
Розглядаємо професійних та талановитих танцівниць до складу танцювально-акробатичного шоу.

Робота в готелях 5 * (без косумації!)

Сезон 2026(квітень-жовтень)

Компанія надає:

✅ офіційне працевлаштування з оформленням робочої візи;

✅ проживання;

✅ харчування;

✅ трансфер;

✅ з.п.  900 $

Критерії відбору:

✅ професійна хореографічна база;

✅ спортивне та підтягнуте тіло;

✅ вміння працювати у команді;

✅ зріст від 1,68.

Дані для подання заявки:

✅ ПІБ;

✅ громадянство;

✅ вік;

✅ 2 відеоматеріали у різних танцювальних напрямках.

Надсилайте свої дані, вказуючи тему: “LB26” на пошту:

lana.academymice10@gmail.com

